import { useState, useEffect } from "react"
import { Outlet, Link } from "react-router-dom";

export default function Create() {
    const [form, setForm] = useState({})
    function handleChange(event) {
        if (event.target.name === "author") {
            setForm(prevForm => { return   { ...prevForm, author : event.target.value } })
        }
        if (event.target.name ==="title") {
            setForm(prevForm => { return { ...prevForm, title : event.target.value }})
        }
        if (event.target.name === "textarea") {
            setForm(prevForm=> { return { ...prevForm, text : event.target.value }})
        }
    }
    function postForm(event) {
        event.preventDefault()
        console.log(form)
    }
    return (
        <div>
            <div onSubmit={postForm} className="formbox">
                <form method="POST">
                    <div>
                        <label for="author" >Author : </label>
                        <input type={"text"} name="author" id={"authorinput"} onChange={handleChange} />
                    </div>

                    <div>
                        <label for="title" >Title : </label>
                        <input type={"title"} id={"titleinput"} onChange={handleChange} />
                    </div>

                    <div>
                        <label for="textarea" >Text : </label>
                        <textarea name="textarea" id="textarea" onChange={handleChange} />
                    </div>
                    <input type={"submit"} value="Submit" />
                </form>
            </div>
        </div>
    )
}
